const texto = ($json.body?.data?.message?.conversation || '').toLowerCase();

let status = '';
if (texto.includes('aprovar')) status = 'aprovado';
else if (texto.includes('rejeitar')) status = 'rejeitado';

// 1) Tenta captar "aprovar 700" / "rejeitar 700"
let row_number = null;
const mRow = texto.match(/(?:aprovar|rejeitar)\s+(\d{1,7})/);
if (mRow) row_number = Number(mRow[1]);

// 2) (Opcional) fallback: se vier no formato antigo "noticia_20250805_..."
let noticia_id = '';
const mId = texto.match(/noticia_\d{8}(?:_\d+)+/i);
if (mId) noticia_id = mId[0];

return [{
  json: { status, row_number, noticia_id }
}];
